INSERT INTO toa_sms_send VALUES ('8033','廖蔚','廖总，因您在忙所以在此向您报告四件事\r\n一、我昨天晚上加班把金融支持扶贫对象政策初稿弄出来了，先发一个给您，下午覃佳过来听您的意见后再修改。\r\n二、中午我去火车站接浙大卢主任，然后陪同简单吃个午餐。\r\n三、下午我要去医院做一项检查，是一月前预约好的，特向您请个假。\r\n四、国家的表彰今天已经在四川日报登了，我让覃佳把拟稿准备好请您签字，如果公示完毕没有意见就直接呈报了。<a href=\"data/uploadfile/65/20140717/20140717021310.doc\" target=\"_blank\">附件下载</a>','65','2014-07-17 10:18:20');
