INSERT INTO toa_sms_send VALUES ('10177','张海鹏','四川省创新金融扶贫机制政策意见\r\n\r\n为贯彻落实银发〔2014〕65号、川委厅〔2014〕9号和《关于深入推进金融支持扶贫惠农工程全面做好四川省扶贫开发金融服务工作的实施意见》，增强金融扶贫创新机制的操作性、实效性，发挥金融扶贫作用，切实为贫困地区、贫困村、贫困户带来实惠，制定以下政策意见。\r\n一、扶贫小额信用贷款\r\n扶贫小额信用贷款是指金融机构在贫困地区针对建档立卡贫困户，在核定的额度和期限内发放的“免担保、免抵押”贷款。\r\n（一）贷款对象。有贷款意愿、有良好信用、有就业创业潜质的建档立卡贫困户。\r\n（二）贷款用途。\r\n1.用于发展种植业、养殖业项目所需贷款。\r\n2.用于发展简单加工业项目所需贷款\r\n3.用于购置小型农机具项目所需贷款。\r\n4.用于建房、治病、子女上学等急需类项目贷款。\r\n（三）贷款额度、利率及期限。对符合贷款条件的建档立卡贫困户提供5万元以下贷款、执行银行基准利率、贷款期限一般在三年以内。\r\n（四）政策措施。\r\n1.在开展“信用户、信用村、信用乡镇”创建活动的基础上，针对贫困户的实际情况，完善评级授信办法，对全省建档立卡贫困户进行专项评级和授信。\r\n2.大幅度增加贫困地区支农再贷款的规模，逐步提高支农再贷款用于支持建档立卡贫困户的比重，降低建档立卡贫困户用款成本。\r\n3.由地方财政出资，以县为单位，按照扶贫小额信贷总额的3%左右，建立扶贫小额信贷风险资金，用于补偿坏账损失。\r\n4.由地方财政出资，购买扶贫小额信贷保险，成本控制在1%以内，用于分散扶贫小额信用贷款风险。\r\n5．探索建立县、乡（镇）、村三级联动的扶贫小额信用贷款综合服务平台，为建档立卡贫困户提供金融、项目、技术、信息等服务。\r\n（五）工作程序。\r\n1.信用评级。\r\n（1）组织领导。以县为单位组织对建档立卡贫困户进行信用评定。成立县级评定小组，小组成员以县扶贫移民局（办）和县级金融机构人员和乡（镇）村干部为主，同时吸收驻村干部和农户代表参加。\r\n（2）信用评定。\r\n○1申请。贫困农户向所在村提出信用评定申请。\r\n○2申报。行政村逐级上报至县级评定小组。\r\n○3调查。县级评定小组组织人员调查农户相关情况，提出信用状况评定建议。\r\n○4评定。由信用评定小组按照农户信用评定办法，对申请人进行信用评定，等级分为AAA、AA、A三个档次。\r\n○5发放信用凭证。县级金融机构根据农户的信用评定等级，核定发放相应等级的信用凭证，一户一证。\r\n2.申请贷款。建档立卡贫困户可以持信用凭证及有效身份证件，到当地金融机构营业网点申请贷款。\r\n二、扶贫贴息贷款\r\n扶贫贴息贷款是为解决贫困地区贫困户和中小型扶贫企业发展生产的资金需求，由政府部门安排贷款额度和财政贴息资金，金融机构发放的贷款。\r\n（一）贷款对象。\r\n1.到户贷款的对象为建档立卡贫困户。\r\n2.项目贷款的对象为履行扶贫义务、处于成长期、与广大贫困户联系密切、致富带动力强的扶贫企业。\r\n（二）贷款用途。\r\n1.到户贷款重点用于贫困户发展和改善生产生活条件。\r\n2.项目贷款重点用于与贫困村、贫困户增加收入紧密相关的产业发展项目。\r\n（三）贴息资金规模、利率及期限。\r\n1.贴息资金规模。全省安排扶贫贴息资金总规模1亿元，其中，安排中央专项资金5000万元、省财政配套5000万元。各地根据实际安排配套资金。50%的扶贫贴息资金用于到户贷款贴息，其余资金用于项目贷款贴息。\r\n2.贴息利率。到户贷款按年利率5%、项目贷款按年利率3%的标准，给予贴息。\r\n3．贴息期限。全省统一执行1年的贴息期限。\r\n（四）贴息方式。实行先贷款后贴息的办法。贴息资金既可直接补贴给贫困户和项目实施单位，也可通过金融机构间接补贴给贫困户和项目实施单位。具体采取何种方式，由各地自行确定。鼓励直接补贴到贫困户和项目实施单位。\r\n（五）贴息确认。到户贷款由县确认，经县扶贫移民局（办）、财政局共同确认签章后，财政局拨付贴息资金。贴息对象的选择，既可由金融机构在扶贫部门提供的贴息贷款农户备选名单中选择贷款对象发放贷款，也可由扶贫部门会同财政部门在金融机构已贷农户中选择合规对象进行贴息。\r\n项目贷款由县申报、市（州）确认、报省备案，经市（州）和扩权强县试点县扶贫办、财政局确认签章后，财政局拨付贴息资金。贴息对象的选择，既可由金融机构在扶贫部门建立的项目库中选择申贷单位发放贷款，也可由扶贫部门会同财政部门在金融机构已贷项目中选择合规贷款单位进行贴息。\r\n（六）贴息资金管理。到户贷款的贴息资金直接安排到县，由县管理。项目贷款的贴息资金安排到市（州）、扩权强县试点县，由市（州）、扩权强县试点县管理，省在当年第四季度视各地项目贷款工作指标完成情况，及时调剂年度计划指标，下拨贴息资金，据实贴息。财政贴息资金要存入财政扶贫资金专户，实行专账管理。贴息资金不得用于贴息范围之外的其他支出。如有结余，可结转下年度继续使用。\r\n三、小额信贷风险资金\r\n小额信贷风险资金是由政府主导设立的鼓励和促进银行业金融机构增加对贫困地区贷款的政府引导性专项资金。\r\n（一）风险资金设立。全省有扶贫任务的178个县级财政每县设立小额信贷风险资金300万元，并保持动态平衡。资金规模可根据县域经济发展和扶贫开发需要逐步扩大。\r\n（二）风险资金使用。\r\n1.资金存入贷款发放银行，作为贷款担保资金和风险补偿金。贷款发放银行按照不低于1：5（或1：10）的比例投放贷款。\r\n2.扶贫贷款风险补偿。如遇市场原因，造成贷款贫困户不能如期偿还贷款的，经贷款发放银行核实批准，可延期一年偿还。如遇天灾人祸或不可抗力因素而造成贷款损失的，由贷款发放银行申请，贷款农户、村委会、乡（镇）政府确认，资金管理部门批准，用资金直接补偿贷款本金的30%，剩余70%由承贷银行继续追偿，并承担最终损失风险。\r\n（三）风险资金管理。\r\n1.县财政局、扶贫移民局（办）和金融办是资金的主管部门，共同负责风险补偿资金年度使用计划的拟定和相关管理工作，向县政府报告风险补偿资金年度使用情况及效果。\r\n2.对单户扶贫企业和各类农业经营性组织提供的保证金额最高不得超过资金总额的10%，对个人提供的保证金额最高不得超过资金总额的5%。资金年度未解除保证责任的保证金额总额一般不超过资金总额的5倍，最高不得超过10倍。\r\n3.资金建立后，应统一管理，统一审核，统一拨付。接受财政、银监、人行、审计等相关部门的监督管理。\r\n四、商业银行注资开展贫困村互助资金\r\n商业银行注资开展贫困村互助资金是以财政扶贫资金为引导，商业银行注资为特点，村民自愿按一定比例交纳的互助金为依托，无任何附加条件的社会捐赠资金为补充，在贫困村建立的民有、民用、民管、民享、周转使用的生产发展资金。\r\n（一）工作对象。商业银行注资开展贫困村互助资金对象须满足以下条件：\r\n1.建档立卡贫困村。\r\n2.具有一定的资源条件，有产业带动。\r\n3.村“两委”班子战斗力强。\r\n4.群众积极性高，村风民风淳朴。\r\n（二）资金用途。互助资金用于支持贫困村农户发展产业及生产性增收项目。\r\n（三）资金额度。商业银行每村注资30?50万元。\r\n（四）贷款额度、贴息利率及期限。视贫困户生产情况一般提供2?5万元贷款、贴息利率5%、贷款期限一年。\r\n（五）工作程序。商业银行注资开展贫困村互助资金在现有贫困村互助资金试点村基础上扩大到全省建档立卡贫困村。\r\n1.确定试点范围和授信额度。由扶贫部门推荐选择互助资金运作规范，管理能力强，积极性高的互助社，再由金融机构对其运行情况和信用情况进行评估，确定授信额度。\r\n2.批发资金给互助社。在授信额度内，由金融部门按照互助社的需求，批发贷款（优惠）给互助社。\r\n3.互助社规划运作。互助社按照互助资金操作模式与程序以及试点要求借款给农户，并负责资金的回收和与金融机构结算。\r\n（六）资金管理。\r\n1. 互助资金由村民会员民主管理，成立管理委员会和监督委员会，负责借款的审批、发放、回收、组织各种活动等具体事务。\r\n2. 互助资金实行专款专用，专帐核算，采取共同参与、民主决策、共同监督、村内互助、有借有还、周转使用、滚动发展的办法。<a href=\"data/uploadfile/68/20140729/20140729074007.doc\" target=\"_blank\">附件下载</a>','68','2014-07-29 15:40:16');
