INSERT INTO toa_sms_send VALUES ('10820','高明','嘉局：\r\n我昨天下午与王强参会，根据你的具体指导在会上提出：草拟中的五条意见抓住了要害，具有可操作性。鉴于五条意见中没有涉及扶贫内容，提出建议如下。\r\n新农村新聚居点建设、入住与扶贫工作进行有机联系，这也是提高入住率的有效途径。建议意见中考虑优惠贫困户入住问题。\r\n具体建议，由政府控制或买断小比例房源，优惠租借给贫困户，参照城市经济适用房办法施行。\r\n好处，提升政府形象，惠及贫困家庭，促进工作整合，切实有助于东明书记批示问题的解决。\r\n王强作了重点解释，强调四大片区外的贫困家庭改善居住的一个重要契机就是同步参与新聚居点安置。\r\n农工委刘主任最后表示，根据大家意见修改定稿，传相关单位后上会审批。\r\n\r\n                              学勤','255','2014-08-01 10:06:56');
