INSERT INTO toa_sms_send VALUES ('15936','廖蔚','四川省扶贫和移民工作局关于我省落实国务院《发达省（市）对口支援四川云南甘肃省藏区经济社会发展工作方案》的建议意见的复函\r\n\r\n省发展改革委：\r\n我局收到你委《关于我省落实国务院〈发达省（市）对口支援四川云南甘肃省藏区经济社会发展工作方案〉的建议意见（送审稿）》后，高度重视，在局务会上进行了专题研究，现将有关情况函复如下：\r\n一、我局将认真贯彻落实王东明书记和魏宏省长指示，继续做好东西扶贫协作工作，广东省和浙江省对口支援我省藏区工作在你委牵头下，积极配合做好相关工作。\r\n二、鉴于今年浙江省对口帮扶我省藏区项目资金已下达，并与浙江省经合办联系，浙江对口帮扶我省藏区不再编制2014-2015年两年期对口支援计划，下步做好2015年对口支援计划和编制2016-2020年5年期对口支援计划。\r\n特此复函。\r\n\r\n\r\n                 四川省扶贫和移民工作局\r\n                    2014年9月1日','67','2014-09-01 14:25:14');
