INSERT INTO toa_sms_send VALUES ('15957','廖蔚','四川省扶贫和移民工作局关于我省落实国务院《发达省（市）对口支援四川云南甘肃省藏区经济社会发展工作方案》的建议意见的复函\r\n\r\n省发展改革委：\r\n我局收到你委《关于我省落实国务院〈发达省（市）对口支援四川云南甘肃省藏区经济社会发展工作方案〉的建议意见（送审稿）》后，高度重视，在局务会上进行了专题研究，现将有关情况函复如下：\r\n一、我局将认真贯彻落实王东明书记和魏宏省长指示，继续做好东西扶贫协作工作。\r\n二、广东省和浙江省对口支援我省藏区工作我局不再参与，在你委牵头下，积极配合做好相关工作。\r\n同时，建议在“三、关于建立协调机制的建议”中：领导小组办公室设在省发展改革委，会同省委藏区办、省扶贫移民局，负责对口援藏具体工作，取消“省扶贫移民局”。\r\n特此复函。\r\n\r\n\r\n                 四川省扶贫和移民工作局\r\n                    2014年9月1日','67','2014-09-01 15:00:40');
