INSERT INTO toa_sms_send VALUES ('16642','吴守清,刘燕','关于提供全省扶贫移民工作座谈会局主要领导讲话稿相关基础材料的通知\r\n\r\n\r\n\r\n\r\n各处（室、委）、中心：\r\n\r\n为贯彻落实9月11日上午召开的全省精准扶贫工作推进现场会议精神，9月11日下午，我局拟在广元召开全省扶贫移民工作座谈会议，届时张谷局长将在会上作重要讲话。按照张谷局长指示，为起草好此次会议领导讲话材料，请各处（室、委）、中心根据工作职能，提供需要局长在会上着重强调和安排的重点工作相关基础材料。相关基础材料经分管领导审定后，请将材料电子版于9月5日下午18：00前通过OA系统送政策法规处。\r\n\r\n联系人：张  兵    电话：86512415\r\n\r\n\r\n\r\n                                 政策法规处\r\n\r\n2014年9月3日','3','2014-09-03 16:31:43');
